import { Link } from 'react-router-dom'

import './home.sass'

const Home = () => {
    return (

        <div className='container home'>
            <div className='text-zone'>
                <h1> Hi, <br /> I'm Liz</h1>
            </div>
            <Link to='/contact' className='btn'> Contact</Link>

        </div>

    )
}

export default Home
